// SingleReview.js
import React from 'react';
import styles from './SingleReview.module.css'; // Import CSS module

function SingleReview({ review }) {
    console.log(review);
    const { rating, review_text, created_at, user_id } = review;

    return (
        <div className={styles['single-review-container']}>
            <p className={styles.rating}>Rating: {rating}</p>
            <p className={styles['review-text']}>Review Text: {review_text}</p>
            <p className={styles['created-at']}>Created At: {created_at}</p>
            <p className={styles['user-id']}>User ID: {user_id}</p>
        </div>
    );
}

export default SingleReview;
